import styled from 'styled-components';

export const HeaderContainer = styled.div`
 padding-right: 20px;
  height: 70px;
  width: 100%;
  display: flex;
  justify-content: space-between;
  margin-bottom: 25px;
  background-color: white;

  @media (max-width: 620px) {
    height: 50px;
  }
`
